    <h1 {...{
      "id": "repeater-重复表单"
    }}>{`Repeater 重复表单`}</h1>
    <p>{`重复表单的使用场景非常广，甚至可以延伸至传统的操作型List/Table，总之，Repeater被视为复杂表单的标志。`}</p>
    <p>{`NoForm提供以下几种类型：`}</p>
    <ul>
      <li parentName="ul">{`TableRepeater（弹窗编辑）`}</li>
      <li parentName="ul">{`InlineRepeater(single/multiple)（行内编辑）`}</li>
      <li parentName="ul">{`SelectifyRepeater（多选/单选）`}</li>
    </ul>
    <h2 {...{
      "id": "引入"
    }}>{`引入`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`// 有antd/next两种选择
import { InlineRepeater, TableRepeater, SelectifyRepeater, ActionButton } from 'nowrapper/lib/antd/repeater';
import { InlineRepeater, TableRepeater, SelectifyRepeater, ActionButton } from 'nowrapper/lib/next/repeater';

// 可以赋予重复表单选择的能力，Selectify是高阶组件
const SelectTableRepeater = Selectify(TableRepeater);
const SelectInlineRepeater = Selectify(InlineRepeater);
`}</code></pre>
    <h2 {...{
      "id": "用法"
    }}>{`用法`}</h2>
    <p>{`如下所示，这里用XRepeater来表示各种Repeater，内容的写法与Form内容完全一致，用于描述每一个重复Form。`}</p>
    <p>{`这里的`}<inlineCode parentName="p">{`formConfig`}</inlineCode>{` 则和 `}<strong parentName="p">{`FormCore`}</strong>{` 的构建参数完全保持一致，用于定义每一`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`<XRepeater formConfig={formConfig}>
    <FormItem name="username" label="username"><Input /></FormItem>
    <FormItem name="age" label="age"><Input /></FormItem>
</XRepeater>
`}</code></pre>
    <h2 {...{
      "id": "初体验"
    }}>{`初体验`}</h2>
