    <h2 {...{
      "id": "selectify--repeater"
    }}>{`Selectify + Repeater`}</h2>
    <p><strong parentName="p">{`Selectify`}</strong>{` 赋予上述三种Repeater以选择的能力。`}</p>
    <p>{`同时 `}<strong parentName="p">{`Selectify`}</strong>{` 后的组件通过 `}<inlineCode parentName="p">{`selectMode="multiple|single"`}</inlineCode>{` 来决定多选或单选。`}</p>
